import Nav from 'react-bootstrap/Nav';

export default function Sidebar() {
    return (
        <Navbar sticky='top' className='flex-column Sidebar'>
            <Nav.Item>
                <Nav.Link href='/'>Feed</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link href='/explore'>Explore</Nav.Link>
            </Nav.Item>
        </Navbar>
    )
}
